import React, { useState, useEffect } from 'react';
import axios from 'axios';

const PropertyList = () => {
  const [properties, setProperties] = useState([]);

  useEffect(() => {
    const fetchProperties = async () => {
      try {
        const response = await axios.get('https://realty-in-ca1.p.rapidapi.com/properties/list-residential', {
          headers: {
            'x-rapidapi-host': 'realty-in-ca1.p.rapidapi.com',
            'x-rapidapi-key': '2ee229faf0msh69f4f622b5db54dp15c587jsn0ec1e29629cd'
          },
          params: {
            LongitudeMin: '25.0',
            LatitudeMin: '35.0',
            LongitudeMax: '45.0',
            LatitudeMax: '42.0',
            CurrentPage: '1',
            RecordsPerPage: '10',
            SortOrder: 'A',
            SortBy: 'price',
            CultureId: '1',
            NumberOfDays: '0',
            BedRange: '0-0',
            BathRange: '0-0',
            RentMin: '0',
            RentMax: '0',
            PriceMin: '1000',
            PriceMax: '1000000'
          }
        });

        console.log(response.data); // Gelen verileri konsola yazdır
        setProperties(response.data.Results); // Gelen verileri state'e set et
      } catch (error) {
        console.error('Error fetching properties', error);
      }
    };

    fetchProperties();
  }, []);

  return (
    <div>
      <h1>Emlak Listesi</h1>
      <ul>
        {properties.map(property => (
          <li key={property.Id}>
            <h2>{property.Property.Address.AddressText}</h2>
            <p>Fiyat: {property.Property.Price}</p>
            {property.Property.Photo && (
              <img src={property.Property.Photo[0].HighResPath} alt={property.Property.Address.AddressText} />
            )}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default PropertyList;
